-- ----------------------------
-- Table structure for mmall_activity
-- ----------------------------
DROP TABLE IF EXISTS `mmall_activity`;
CREATE TABLE `mmall_activity` (
  `id` int(11) NOT NULL COMMENT '主键',
  `product_id` int(11) DEFAULT NULL COMMENT '抢购商品id',
  `title` varchar(255) DEFAULT NULL,
  `desc` varchar(1000) DEFAULT NULL,
  `begin_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '抢购开始时间',
  `end_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '抢购结束时间',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

